    false,nt"url": null,nt"notes": "This narrative report for Wertheim National
    Wildlife Refuge outlines Refuge accomplishments during the 1976 calendar year. The
    report begins with an introduction to the Refuge and information about weather conditions,
    habitat conditions, and land acquisition activities. Construction, maintenance,
    and wildfires are also described. Habitat management is covered; wetlands are discussed.
    The wildlife section of the report discusses endangered species, threatened species,
    migratory birds, mammals, and non-migratory birds. Interpretation and recreation
    activities are outlined; topics include fishing, hunting, and law enforcement. Items
    of interest are included.",nt"license_title": "License Not Specified",nt"extras":
